import Home from "../pages/Home/Home";
import Contato from "../pages/Contato/Contato";

export const routesConfig = [
    {
        path: "/",
        component: Home,
        exact: true
    },
    {
        path: "/contato",
        component: Contato,
        exact: true
    }
];
